import axios from 'axios';

function Exchange() {

    const {currencies, setCurrencies} = useState([]);

    useEffect(() => {
        axios.get("https://api.exchangeratesapi.io/latest").then(res => {
            setCurrencies(...currencies, res.data)

        })

    }, []);



    return (
        <div>
            {}
        </div>
    );
}


export default Exchange;
